import { API_BASE_URL } from "../state";
import { state } from "../state";
import mapboxgl from "mapbox-gl";
mapboxgl.accessToken =
  "pk.eyJ1Ijoibmljb2xhc2Nhc211eiIsImEiOiJjbGlnazg2cjExZTdvM21tcWl6eGU5bDM0In0.EtaC4N7nb_NuwfddaKZaow";

customElements.define(
  "map-comp",
  class extends HTMLElement {
    petId: number;
    picURL: string;
    name: string;
    details: string;
    lat: number;
    lng: number;
    constructor() {
      super();
      this.render();
      this.connectedCallback();
    }
    connectedCallback() {
      this.render();
      const cs = state.getState();

      const mapEl = this.querySelector("#map") as HTMLElement;
      const topMenuEl = this.querySelector(
        "set-radius-form-comp"
      ) as HTMLElement;
      const formRadiusEl = topMenuEl.querySelector(
        ".search-form"
      ) as HTMLElement;

      var map = new mapboxgl.Map({
        container: mapEl,
        style: "mapbox://styles/mapbox/streets-v11",
        center: [cs.lng, cs.lat],
        zoom: 12,
      });

      formRadiusEl.addEventListener("submit", async (e: any) => {
        e.preventDefault();

        const distanceValue = e.target["distance"].value;

        fetch(
          API_BASE_URL +
            "/pets-near-to?lat=" +
            cs.lat +
            "&lng=" +
            cs.lng +
            "&radius=" +
            distanceValue
        )
          .then((res) => res.json())
          .then((results) => {
            for (const p of results) {
              if (p.found == false && p.userId != cs.userId) {
                const { lat, lng } = p._geoloc;
                const marker = new mapboxgl.Marker({ color: "#eb6372" })
                  .setLngLat([lng, lat])
                  .addTo(map);
                state.getPetsByRadius(results);

                marker.getElement().addEventListener("click", async () => {
                  const { lng, lat } = marker._lngLat;

                  const selectedPetOnMap = cs.petsByRadius.find((p) => {
                    return p.lng == lng && p.lat == lat;
                  });

                  cs.selectedPet = selectedPetOnMap;
                  state.setState(cs);

                  this.petId = selectedPetOnMap.id;
                  this.picURL = selectedPetOnMap.picURL;
                  this.name = selectedPetOnMap.name;
                  this.details = selectedPetOnMap.details;
                  this.lat = selectedPetOnMap.lat;
                  this.lng = selectedPetOnMap.lng;

                  this.connectedCallbackSelectedPet();
                });
              }
            }
          });
      });
    }
    render() {
      this.innerHTML = `
            <set-radius-form-comp></set-radius-form-comp>
            <div class="map-container">
                <div id="map"></div>
            </div>
          `;

      const style = document.createElement("style");
      style.innerHTML = `
            .map-container {
            display: grid;
            justify-items: center;
            align-items: center;
            }
            #map {
            width: 100vw;
            height: calc(100vh - 130px);
            }
            .mapboxgl-ctrl {
            display: none;
            }

            .mapboxgl-map {
              font: 12px/20px Helvetica Neue, Arial, Helvetica, sans-serif;
              overflow: hidden;
              position: relative;
              -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
            }
            .mapboxgl-canvas {
                position: absolute;
                left: 0;
                top: 0;
            }
            .mapboxgl-map:-webkit-full-screen {
                width: 100%;
                height: 100%;
            }
            .mapboxgl-canary {
                background-color: salmon;
            }
            .mapboxgl-canvas-container.mapboxgl-interactive,
            .mapboxgl-ctrl-group button.mapboxgl-ctrl-compass {
                cursor: grab;
                -webkit-user-select: none;
                user-select: none;
            }
            .mapboxgl-canvas-container.mapboxgl-interactive.mapboxgl-track-pointer {
                cursor: pointer;
            }
            .mapboxgl-canvas-container.mapboxgl-interactive:active,
            .mapboxgl-ctrl-group button.mapboxgl-ctrl-compass:active {
                cursor: grabbing;
            }
            .mapboxgl-canvas-container.mapboxgl-touch-zoom-rotate,
            .mapboxgl-canvas-container.mapboxgl-touch-zoom-rotate .mapboxgl-canvas {
                touch-action: pan-x pan-y;
            }
            .mapboxgl-canvas-container.mapboxgl-touch-drag-pan,
            .mapboxgl-canvas-container.mapboxgl-touch-drag-pan .mapboxgl-canvas {
                touch-action: pinch-zoom;
            }
            .mapboxgl-canvas-container.mapboxgl-touch-zoom-rotate.mapboxgl-touch-drag-pan,
            .mapboxgl-canvas-container.mapboxgl-touch-zoom-rotate.mapboxgl-touch-drag-pan .mapboxgl-canvas {
                touch-action: none;
            }
            .mapboxgl-ctrl-bottom-left,
            .mapboxgl-ctrl-bottom-right,
            .mapboxgl-ctrl-top-left,
            .mapboxgl-ctrl-top-right {
                position: absolute;
                pointer-events: none;
                z-index: 2;
            }
            .mapboxgl-ctrl-top-left {
                top: 0;
                left: 0;
            }
            .mapboxgl-ctrl-top-right {
                top: 0;
                right: 0;
            }
            .mapboxgl-ctrl-bottom-left {
                bottom: 0;
                left: 0;
            }
            .mapboxgl-ctrl-bottom-right {
                right: 0;
                bottom: 0;
            }
            .mapboxgl-ctrl {
                clear: both;
                pointer-events: auto;
                transform: translate(0);
            }
            .mapboxgl-ctrl-top-left .mapboxgl-ctrl {
                margin: 10px 0 0 10px;
                float: left;
            }
            .mapboxgl-ctrl-top-right .mapboxgl-ctrl {
                margin: 10px 10px 0 0;
                float: right;
            }
            .mapboxgl-ctrl-bottom-left .mapboxgl-ctrl {
                margin: 0 0 10px 10px;
                float: left;
            }
            .mapboxgl-ctrl-bottom-right .mapboxgl-ctrl {
                margin: 0 10px 10px 0;
                float: right;
            }
            .mapboxgl-ctrl-group {
                border-radius: 4px;
                background: #fff;
            }
            .mapboxgl-ctrl-group:not(:empty) {
                box-shadow: 0 0 0 2px rgba(0, 0, 0, 0.1);
            }
            @media (-ms-high-contrast: active) {
                .mapboxgl-ctrl-group:not(:empty) {
                    box-shadow: 0 0 0 2px ButtonText;
                }
            }
            .mapboxgl-ctrl-group button {
                width: 29px;
                height: 29px;
                display: block;
                padding: 0;
                outline: none;
                border: 0;
                box-sizing: border-box;
                background-color: transparent;
                cursor: pointer;
                overflow: hidden;
            }
            .mapboxgl-ctrl-group button + button {
                border-top: 1px solid #ddd;
            }
            .mapboxgl-ctrl button .mapboxgl-ctrl-icon {
                display: block;
                width: 100%;
                height: 100%;
                background-repeat: no-repeat;
                background-position: 50%;
            }
            @media (-ms-high-contrast: active) {
                .mapboxgl-ctrl-icon {
                    background-color: transparent;
                }
                .mapboxgl-ctrl-group button + button {
                    border-top: 1px solid ButtonText;
                }
            }
            .mapboxgl-ctrl-attrib-button:focus,
            .mapboxgl-ctrl-group button:focus {
                box-shadow: 0 0 2px 2px #0096ff;
            }
            .mapboxgl-ctrl button:disabled {
                cursor: not-allowed;
            }
            .mapboxgl-ctrl button:disabled .mapboxgl-ctrl-icon {
                opacity: 0.25;
            }
            .mapboxgl-ctrl button:not(:disabled):hover {
                background-color: rgba(0, 0, 0, 0.05);
            }
            .mapboxgl-ctrl-group button:focus:focus-visible {
                box-shadow: 0 0 2px 2px #0096ff;
            }
            .mapboxgl-ctrl-group button:focus:not(:focus-visible) {
                box-shadow: none;
            }
            .mapboxgl-ctrl-group button:focus:first-child {
                border-radius: 4px 4px 0 0;
            }
            .mapboxgl-ctrl-group button:focus:last-child {
                border-radius: 0 0 4px 4px;
            }
            .mapboxgl-ctrl-group button:focus:only-child {
                border-radius: inherit;
            }
            .mapboxgl-ctrl button.mapboxgl-ctrl-zoom-out .mapboxgl-ctrl-icon {
                background-image: url("data:image/svg+xml;charset=utf-8,%3Csvg width='29' height='29' viewBox='0 0 29 29' xmlns='http://www.w3.org/2000/svg' fill='%23333'%3E %3Cpath d='M10 13c-.75 0-1.5.75-1.5 1.5S9.25 16 10 16h9c.75 0 1.5-.75 1.5-1.5S19.75 13 19 13h-9z'/%3E %3C/svg%3E");
            }
            .mapboxgl-ctrl button.mapboxgl-ctrl-zoom-in .mapboxgl-ctrl-icon {
                background-image: url("data:image/svg+xml;charset=utf-8,%3Csvg width='29' height='29' viewBox='0 0 29 29' xmlns='http://www.w3.org/2000/svg' fill='%23333'%3E %3Cpath d='M14.5 8.5c-.75 0-1.5.75-1.5 1.5v3h-3c-.75 0-1.5.75-1.5 1.5S9.25 16 10 16h3v3c0 .75.75 1.5 1.5 1.5S16 19.75 16 19v-3h3c.75 0 1.5-.75 1.5-1.5S19.75 13 19 13h-3v-3c0-.75-.75-1.5-1.5-1.5z'/%3E %3C/svg%3E");
            }
            @media (-ms-high-contrast: active) {
                .mapboxgl-ctrl button.mapboxgl-ctrl-zoom-out .mapboxgl-ctrl-icon {
                    background-image: url("data:image/svg+xml;charset=utf-8,%3Csvg width='29' height='29' viewBox='0 0 29 29' xmlns='http://www.w3.org/2000/svg' fill='%23fff'%3E %3Cpath d='M10 13c-.75 0-1.5.75-1.5 1.5S9.25 16 10 16h9c.75 0 1.5-.75 1.5-1.5S19.75 13 19 13h-9z'/%3E %3C/svg%3E");
