            .mapboxgl-touch-pan-blocker-show {
                opacity: 1;
                transition: opacity 0.1s ease-in-out;
            }
            .mapboxgl-canvas-container.mapboxgl-touch-pan-blocker-override.mapboxgl-scrollable-page,
            .mapboxgl-canvas-container.mapboxgl-touch-pan-blocker-override.mapboxgl-scrollable-page .mapboxgl-canvas {
                touch-action: pan-x pan-y;
            }
            .mapboxgl-ctrl {
            display: none;
            }
          `;

      this.appendChild(style);
    }
    connectedCallbackSelectedPet() {
      this.renderSelectedPet();
      const cs = state.getState();

      const mapEl = this.querySelector("#map") as HTMLElement;
      const missingPetCardEl = this.querySelector(
        "missing-pet-card-comp"
      ) as HTMLElement;
      const exitButtonEl = missingPetCardEl.querySelector(
        ".exit-button"
      ) as HTMLElement;
      const cardContainerEl = missingPetCardEl.querySelector(
        ".card__container"
      ) as HTMLElement;
      const reportButtonEl = missingPetCardEl.querySelector(
        ".card__button"
      ) as HTMLElement;
      const reportFormEl = missingPetCardEl.querySelector(
        "report-form-comp"
      ) as HTMLElement;
      const sentInfoEl = missingPetCardEl.querySelector(
        "sent-info-comp"
      ) as HTMLElement;
      const sentInfoButtonEl = sentInfoEl.querySelector(
        ".sent-info__button"
      ) as HTMLElement;

      new mapboxgl.Map({
        container: mapEl,
        style: "mapbox://styles/mapbox/streets-v11",
        center: [this.lng, this.lat],
        zoom: 16,
      });

      exitButtonEl.addEventListener("click", () => {
        this.connectedCallback();
      });

      reportButtonEl.addEventListener("click", () => {
        reportFormEl.style.display = "block";
        cardContainerEl.style.display = "none";
      });

      sentInfoButtonEl.addEventListener("click", () => {
        this.connectedCallback();
      });

      reportFormEl.addEventListener("submit", async (e: any) => {
        e.preventDefault();

        const infoValue = e.target["info"].value;

        const mail = {
          myEmail: cs.email,
          myName: cs.nickname,
          ownerEmail: cs.selectedPet.ownerEmail,
          ownerName: cs.selectedPet.ownerName,
          missingPetName: cs.selectedPet.name,
          info: infoValue,
        };

        console.log("mail: ", mail);

        await fetch(API_BASE_URL + "/send-mail", {
          method: "post",
          headers: {
            "content-type": "application/json",
          },
          body: JSON.stringify(mail),
        }).then(() => {
          reportFormEl.style.display = "none";
          sentInfoEl.style.display = "block";
        });
      });
    }
    renderSelectedPet() {
      this.innerHTML = `
            <div class="map-container">
                <missing-pet-card-comp id="${this.petId}" picURL="${this.picURL}" name="${this.name}" details="${this.details}"></missing-pet-card-comp>
                <div id="map"></div>
            </div>
          `;

      const style = document.createElement("style");
      style.innerHTML = `
            .map-container {
            display: grid;
            justify-items: center;
            align-items: center;
            }
            missing-pet-card-comp {
            z-index: 10;
            position: fixed;
            margin-top: -40px;
            }
            #map {
            z-index: -10;
            width: 100vw;
            height: calc(100vh - 60px);
            }
            .mapboxgl-ctrl {
            display: none;
            }
          `;

      this.appendChild(style);
    }
  }
